from ryu.base import app_manager
from ryu.controller import ofp_event
from ryu.controller.handler import CONFIG_DISPATCHER, MAIN_DISPATCHER
from ryu.controller.handler import set_ev_cls
from ryu.ofproto import ofproto_v1_3
import time

class MyController(app_manager.RyuApp):
    OFP_VERSIONS = [ofproto_v1_3.OFP_VERSION]

    def __init__(self, *args, **kwargs):
        super(MyController, self).__init__(*args, **kwargs)
        self.packet_out_times = {}

    @set_ev_cls(ofp_event.EventOFPPacketIn, MAIN_DISPATCHER)
    def packet_in_handler(self, ev):
        now = time.time()
        msg = ev.msg
        dp = msg.datapath
        if dp.id not in self.packet_out_times:
            return
        packet_out_time = self.packet_out_times[dp.id]
        duration = now - packet_out_time
        print("Duration between packet_out and packet_in: %f seconds" % duration)

    @set_ev_cls(ofp_event.EventOFPPacketOut, CONFIG_DISPATCHER)
    def packet_out_handler(self, ev):
        msg = ev.msg
        dp = msg.datapath
        self.packet_out_times[dp.id] = time.time()

